11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Evrenselde çağların en büyük büyücülerinden biri olarak bilinir. Oldukça zeki, cömert, yumuşak başlı ve anlayışlı yapısıyla üstün yeteneklidir. Tüm kılık değiştirmelerine bakıldığında, genellikle tavşana dönüşür ve onun büyünün arkasındaki gerçek yüzünü yalnızca bir kaç kişi görür."],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"Kabilenin efsanevi hikaye anlatıcısı ve müzik bestecisi. Karada ve denizde dolaşırken, onu hiç kimse görmedi. Derin ses tonu ve zekasıyla çok sayıda kaside söylenmiştir. "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Saf ve güzel. Dünyanın her yeri hakkında çok meraklıdır, kendisini iyi hissetiği zamanlarda bateri çalmayı sever. "],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"Tüm aslanların Kralıdır ve insan gibi yürür. Bir zamanlar kabile üyeleriyle birlikte harika anavatanını kaybetti ama sahip olduğu olağanüstü güç, bilirkişilik ve cesurluk özellikleri sayesinde gerçek lider sonunda onu geri kazanacaktır."],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
