12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%> Vay canına, bir <color=#ef933d>Genç Embla Oyması</color>! Güçleri de azaldı! Oymaları birleştirerek <color=#f58c26>Embla'yı</color> uyandırmalıyız."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Seviyede bu oymalar varsa genellikle onları birleştirerek seviyeyi geçebilirsin."],
