12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Söylediğimiz gibi, <color=#38c0a5>Yabani Ruh Küresi'ne</color> dokunarak araziyi uyandırabilirsin."],
