12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Bazı <color=#38aec0>Süper Uyuyan Araziler</color>, <color=#f58c26>İyileştirme puanlarıyla</color> uyandırılamaz, yalnızca üzerindeki nesneleri normal arazilerdeki nesnelerle birleştirilerek uyandırılabilir."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>Artık seviyeler, <color=#f58c26>Görevlerle</color> birlikte gelecek."],
