12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Bu buton <color=#f58c26>Ekran Sürükleme Fonksiyonu'nu</color> açar ve kapatır."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Bazı nesneler doğrudan birleştirilemez. Dokunarak <color=#ef933d>Kama Şekilli Kaya Yığını'nı</color> <color=#ef933d>Kama Şekilli Kaya'ya</color> dönüştür ve sonrasında birleştir. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%><color=#f58c26>Seviye Hedefleri'ni</color> kontrol etmen gerekiyor."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%><color=#ef933d>Ejderha Kemikleri'nden</color> <color=#38c0a5>Çalı Filizleri</color> alabiliriz."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Bu büyük bir<color=#ef933d>Uyandırma Bombası</color>.Yanındaki araziyi uyandırırsan otomatik olarak uyanır ve kendisini çevreleyen her araziyi uyandırır."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"Kabile üyeleri, yüksek seviye <color=#38c0a5>Asmalar'dan</color> <color=#38c0a5>Yabani Cevher</color> toplayabilir."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Bu <color=#ef933d>Parçalanmış Mezar</color>. Eğer ihmal eder veya birleştirirsen <color=#df66a8>Zombi'ye</color> dönüşür. Seviyeyi geçmek için gereken <color=#38c0a5>Ateşböcekleri'ni</color> almak için onları yok et."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"Bir <color=#ef933d>Terkedilmiş Duvar Yuvası</color> uyurken bile sürekli zombi oluşturur. Dokunmak, anında zombi oluşmasını sağlar! Zombileri yok etmek <color=#38c0a5>Yabani Cevher</color> kazandırır."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Ne kadar şanslıyız! Bu bir <color=#38c0a5>Druid'in Runik Portalı</color>. Ev'den bir <color=#38c0a5>Kabile Üyesi</color> çağırmak için birleştir!"],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"Kutsal Yaratılış Ağacı'nın kalıntıları. Otomatik olarak <color=#38c0a5>Yabani Ruh Küresi</color> oluşturur. Seviyesi ne kadar yüksekse o kadar iyileştirme gücü o kadar yüksektir."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" Burada sürekli <color=#ef933d>Bulut</color> oluşacaktır. Yağmur yağdırmak için dokun. Altındaki boş alanlarda <color=#38c0a5>Su Birikintileri</color> ve <color=#38c0a5>Ruh Çiçekleri</color> oluşacaktır."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>İlginç... <color=#ef933d>Genç Embla Oymalar'ı</color> nerede?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>Oh, evet eğer <color=#f58c26>Görevleri'ni</color> bitirirsen ortaya çıkacaklar!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Bu <color=#ef933d>Şeytan Heykeli</color>. İğrenç bir eser! <color=#ef933d>Genç Embla Oyması</color> almak için insanlarına yıkım emri ver!"],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>Yeni bir Kamp açıldı! Dünya Haritası'ndan göz atabilirsin!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>Sonunda özgürüm! Çok teşekkür ederim! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>Kabilemizden insanlar <color=#38c0a5>Totemler'in</color> içinde sıkıştı!"],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>Kabilenin hem Evde hem de burada başka kabile üyeleri bulmak için yardımınına ihtiyacı var!"],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>Onları diğer seviyede ara!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"<color=#f58c26>Çift tıklayarak</color> bazı nesneleri hasat etmesi için birilerini çağırabilirsin."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>Topladığın nesneleri kullanabilir veya birleştirebilirsin."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%><color=#38c0a5>Yabani Ruh Küresi</color> almak için <color=#38c0a5>Yabani Ruh Küresi</color> hasadı yap."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Küreye</color> dokunarak <color=#38aec0>Uyuyan Arazi'yi</color> uyandır."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>Artık her seviyenin sonunda ödüllerini seçebilirsin."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Ödüller genellikle <color=#38c0a5>Altın</color> veya diğer kullanışlı kaynaklardır. Hatta bazen bir totemdir!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Ödüllerin <color=#f58c26>Balon</color> içine koyulup evine gönderilecek."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Burası <color=#f58c26>Ev'imiz</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%><color=#f58c26>Büyük Tufan</color> barışçıl hayatımızı mahvetmeden önce evimiz olan burasıydı. Şimdi ise araziyi kaplayan yoğun bir sis var."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Araziyi doğrudan uyandırmak için nesneleri uyuyan arazidekilerle birleştir! Daha çok kabile üyesi kurtarmak için birleştirmeyi dene! Nüfus ne kadar büyükse o kadar çok sis kaybolur ve o kadar hızlı geri inşaaya başlayabiliriz."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Her seferinde sadece bir<color=#38c0a5>Zaman Hazine Sandığı</color> açabilirsin. Geri sayımı bekleyebilir ya da Yakut harcayarak anında <color=#38c0a5>Zaman Hazine Sandığı</color> alabilirsin."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>Seviye Ödülleri geldi! Balonları açıp içinde ne olduğuna bak!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>Uzunevler</color> işçilerin dinlenebileceği yerlerdir. Belirli bir süreden sonra dışarı çıkarlar."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%><color=#38c0a5>Uzunevler</color> daha yüksek seviyedekilerle birleştirilebilir. Seviye ne kadar yüksekse kabile üyelerinin dinlenme süresi o kadar azalır."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%><color=#38c0a5>Yakut</color> harcayarak kabile üyelerini hemen uyandır!"],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"Daha fazla <color=#38c0a5>Unutulmuş Miras</color> almak için Ev'de daha fazla görev tamamlayabilirsin. Özel ödüller kazanmak için dokun!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Bu küçük bir parça <color=#38c0a5>Altın</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Biraz <color=#38c0a5>Altın</color> almak için dokunabilir ya da daha gelişmiş altın parçacıkları almak için birleştirebilirsin."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%><color=#f58c26>Mağaza'da</color> <color=#38c0a5>Altın</color> harcayabilirsin."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Çok fazla altının mı var? Mağazadan bir sürü güzel şey alabilirsin!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Tüm <color=#df66a8>Kabile Üyeleri</color> çok yorgun. Dinlenmek için ara vermeleri gerekiyor."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>Daha çok seviye tamamlayıp daha çok insan kurtarma zamanı!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Ne kadar çok kabile üyesine sahip olursan uykuya gitmeden önce o kadar çok kaynak toplarlar."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Daha çok kabile üyesi kurtarmak için seviyeleri tamamla!"],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>Ve onları eve geri getir!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Bak! <color=#f58c26>Dünya Haritası'na</color> dokunarak Kamp'a gidebilirsin."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>Bir şey koyacak yer kalmadı. Zemin tamamen kaplandı!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Bir nesne seç ve seçtiğin nesneyi bilgi kutusundan işaretleyerek sat veya at. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Bu çok nadir bir <color=#38c0a5>Uzaylı Mirası</color>.<color=#38c0a5>Yakut</color> almak için dokun ya da birleştirerek daha gelişmiş şeyler oluştur!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Bu bir <color=#38c0a5>Yabani Cevher</color> parçası."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%><color=#38c0a5>Yabani Cevher</color> toplamak için dokunabilir veya birleştirerek daha gelişmiş şeyler oluşturabilirsin!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%><color=#f58c26>Mağaza'dan</color> topladığın <color=#38c0a5>Yabani Cevherler'i</color>harcayabilirsin."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>Eğer <color=#38c0a5>Yabani Cevher</color> depon çok dolmaya başladıysa mağazada da harcayabilirsin."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"Bu <color=#38c0a5>Barikat</color>benim sinirimi bozuyor! Ama doğrudan hareket ettiremezsin. Daha küçük barikatlara dönüştürmek için <color=#df66a8>Kabile Üyeleri'ni</color>saldırıya çağırabilirsin."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>Barbetler</color> uyuyan arazideyken bile arazileri kirletirler. <color=#f58c26>İlerleme Çubuğu</color> her atış arasındaki süreyi gösterir. Sadece uyanık bir barbet'e saldırabilirsin."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Bu bir<color=#f58c26>Kahraman Sunağı</color>. Kahramanlar, <color=#f58c26>Boş Durma Modu</color> ve <color=#f58c26>Devriye Modu</color> arasında geçiş yaparlar."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"Çevrede bir kahraman varsa <color=#f58c26>4 nesne birleştirdiğinde</color> ek sürprizlerle karşılaşacaksın!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"Eğer boş duruyorlarsa <color=#38c0a5>Yakut</color> harcayarak kabile üyelerini hemen uyandırabilirsin!"],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Buraya tıklayarak Kahraman hakkında daha fazla bilgi edinebilirsin!"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Kahramanlar, kabilenin güçlü üyeleri olarak benzersiz özelliklere sahiptir."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Kahraman yeteneklerinin açıklamalarını <color=#f58c26>Kahraman Özelliği Kutusu'ndan</color> kontrol edebilirsin."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Tamamlanmış <color=#f58c26>Görevleri</color> teslim ederek kahramanlara seviye atlatabilirsin."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"Kahramanın'ın seviyesini arttırmak için tüm görevleri bitir!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>İyi iş! Daha fazla kabile üyesi Sihirbazın mühründen kurtuldu!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"Daha çok kabile üyesiyle daha fazla <color=#f58c26>Sis</color>temizleyebilirsin!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>Her bölgedeki sisin temizlenmesi için belirli bir Kabile Gücü seviyesi gerekir."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Şimdi bu bölgedeki sisi temizleyebiliriz!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"Bu sisi henüz temizleyemezsin."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%><color=#f58c26>Kabile Gücü</color> yeterince yüksek değil. Mağazada daha fazla totem satın alabilirsin."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>Totem almak için altın harca!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>Her satın alımdan sonra totemlerin fiyatı artacak. Git ve daha fazla altın al!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>Bu seviyenin <color=#f58c26>Süre Sınırı</color> var. Denemeyi belirtilen süre sınırı içinde bitirmelisin yoksa kaybedersin."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>Ne kadar zaman kaldığını buradan görebilirsin."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>Süre azaldıkça numaraların rengi sırayla <color=#46bb83>Yeşil</color>, <color=#eca852>Sarı</color> ve en sonunda ise <color=#e04030>Kırmızıya</color> dönüşecektir."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>Seviyeyi daha hızlı geçmek için Mağaza'ya göz atabilirsin."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%><color=#38c0a5>Yakut</color> harcayarak önemli nesneleri doğrudan satın alabilirsin."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>Bu tarz seviyeler ödül olarak <color=#38c0a5>Kabile Üyesi</color> verir. <color=#38c0a5>Yakut</color> harcayarak ödülü iki katına çıkarabilirsin."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Tanrı'nın İmtihanı'na hoş geldin! Meydan okumayı tamamladığında ödül kazanacaksın."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Bir imtihanı <color=#f58c26>üç kez</color> tamamlayabilirsin ama her seferinde süre sınırı kısalacak."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Seviye atlamak için kahramanın eğitimi seansının bitmesini beklemen gerekiyor. Süreci hızlandırmak için <color=#38c0a5>Yakut</color> harcayabilirsin."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Bak, bu bir <color=#46bb83>Dolgu Nişi</color> büyük bir sis alanını kontrol eder."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Söz konusu nişe nesneyi sürükleyerek sisi temizleyebilirsin."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Eğer niş hala uyuyorsa önce onu uyandırman gerekecek."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Etkinliğe hoş geldiniz! Sadece kısa bir süreliğine açık olacaktır!"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Etkinliğe katılamak size tonla hediye kazandırır. Hediyeler Ev'ine gönderilecektir."],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Burada benzersiz nesneler, yeni yaratıklar ve yeni oyun biçimleri göreceksin!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>Seviyelerde ilerlemek için meşale gereklidir! Zamanla yenilenirler."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Şimdi tonla meşalen oldu! Hadi onları seviyelerde harca!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>Artık <color=#38c0a5>Kamp Ödülleri'ni</color>kontrol edebilirsin."],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>Zamanı geldiğinde ödüllerini alabilirsin!"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>Seviyelerde ne kadar çok yıldız alırsan o kadar fazla ödül alırsın!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Bak! Haritada tam orada! Kilidini aç ve göz at!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Gözcümüz yeni bir Kamp için harika bir yer buldu, gidip göz at!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>Burada gerçekten ilginç biriyle karşılaşabiliriz!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%><color=#46bb83>Kış Geçidi Etkinliği'ne</color> hoş geldiniz. Harika bir dünya sizi bekliyor."],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>Böyle bir <color=#46bb83>Etkinliğe</color> katılarak binlerce ödül kazanabilirsin ve bu ödüller <color=#f58c26>Ev'ine</color> gönderilir!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>Burada benzersiz nesneler, yeni yaratıklar ve yeni oyun biçimleri göreceksin!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%><color=#46bb83>Masallar Diyarı Etkinliği'ne</color> hoş geldiniz. Harika bir dünya sizi bekliyor."],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>Böyle bir <color=#46bb83>Etkinliğe</color> katılarak binlerce ödül kazanabilirsin ve bu ödüller <color=#f58c26>Ev'ine</color> gönderilir!"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"<line-height=130%>Burada benzersiz nesneler, yeni yaratıklar ve yeni oyun biçimleri göreceksin!"],
