13616=>["Value"=>13616,"TextKey"=>"天气雷名称100001","TextValue"=>"Yıldırım"],
13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"Aynı nesneleri beraber sürüklemek için nesnenin üstüne bir yıldırım koy."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Selamlar şefim, ben Tristan, gözcün! Bu sarsıntılı yolculuğu hepimizin atlatmasına sevindim. Nihayet bölgeye ulaştığımıza göre artık bir <color=#f58c26>Kamp</color> kurabiliriz. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>Burası çok canlıymış! Neyle karşılaşabileceğimizden emin değilim. Kendimizi korumak için çadırımıza destek takarak işe koyulalım!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Aman tanrım, şu pisliğe ve şu çirkin çadıra bak! Evimi çok özledim..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Enda, evden ayrılmanın çok zor olduğunun farkındayım ama orayı kurtarmanın tek yolu ayrılmaktı. Tüm o garip felaketler... Bir cevap bulmalıyız! İşte bu yüzden yardım aramaya karar verdik."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> Ama geri döneceğiz, tamam mı? Öncelikle Tanrı ile konuşman için bir <color=#f58c26>Sunak</color> inşa edelim, olur mu rahip Enda? Şef yardımcı olacak!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Bak ne bulduk! <color=#ef933d>Yabanın Mirası</color>! Bunun sayesinde artık <color=#f58c26>Sunak</color> için ihtiyaç duyduğumuz her şeye sahibiz ve totemlerden kurtulmanın bir yolunu bulmuş olduk! Bu yer adeta kutsanmış!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Stan misin nesin, sanırım tamamen kullanışsız değilmişsin. Her ne kadar evdekinden çok daha küçük ve boğucu olsa da şimdilik yetineceğim! Şimdi git buradan!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Ah, ne kadar da tatlı, ne kadar mutlu olduğuna ve sana nasıl dolaylı şekilde teşekkür ettiğine de bir bak!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%>(garip bir dansı tamamlar) Tanrımız bize doğru yerde olduğumuzu ve yüce bir kişiliğin yardım etmek için bize doğru geldiğini söyledi..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>Gerçekten mi? Bu çok iyi! Bu yüce kişilikle ne zaman tanışacağız?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%>Uykumu bölen serseriler siz miydiniz?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>…...Peki ya sen?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>Ben Baş Druid'im, ozanların babası, fırtınanın fatihi, maceraperestlerin koruyucusu, Tanrı'nın korku salan elçisi, infazcısı, yargıcı ve ilahi ustası Amergin'im! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Ah... Seninle tanışmak güzel, sence de öyle değil mi? Buraya yeni geldik ve duyduk ki..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>Ne?! İstilacı mısınız?! Evimizi yok edemeyecek ve ailelerimizi ayıramayacaksınız! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"Ne? Hayır, hayır! İstilacı değiliz, yalnızca biraz dinlenmek ve mümkünse evimizin topraklarındaki gizemi çözmek için bir yer arıyoruz……"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"Hayır! Köprü! Ne yaptığına bak! Tanrı çok kızacak! Bir saniye... Neyim demiştin? Amergin mi? Efsanelerdeki Baş Druid Amergin?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"Siz…… Siz istilacı değil misiniz? O zaman kimsiniz? Neden buradasınız? Bir saniye... Ben neden buradayım ve burası da neresi? İnsanlarım nerede? Burayı hatırlayamıyorum..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Üzgünüm fakat cevabını biz de bilmiyoruz. Çok uzaklardan geldik, hayatımızı riske attık ve evimizin topraklarındaki gizemi çözmeye yardımcı olacak birilerini bulmaya çalışıyoruz. İlk başta üzerimize yoğun bir sis çöktü ve sonrasında..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"Geçtiğimiz sene son on yıldan daha fazla sel meydana geldi. Daha da garibi, insanlar kendilerini cansız totemlere dönüştürmeye başladı! Buna inanabiliyor musun?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"Ha...bu gerçekten... çok kötüymüş. Saldırıp köprünüzü yok ettiğim için özür dilerim. Belki yeniden inşa etmenize yardımcı olabilirim?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"Amergin?! Kudretli Amergin?! Cüppen, fırtınalara hükmeden gücün... Sen gerçeksin! Ailemin kitabındaki o hikayeler demek ki gerçekmiş!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>İşçiler! Toparlanın ve o köprüyü yeniden inşa edin!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>Ama yaralandık! İnşaata hemen başlayamayız! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"İşte bu iş benlik. Yıllar süren seyahatlerimde bitkisel ilaçlarla ilgili çok şey öğrendim. Şimdi biraz bitki toplayalım ve burada bir <color=#f58c26>Bitki Bahçesi</color> oluşturalım. Bu da benim sizden özrüm olsun."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"Teşekkür ederim! Çok iyisin. Artık nasıl olduğunu öğrendiğimize göre daha sonra eve gidip totemlerde sıkışıp kalanları da kurtaracağız! Harika, haydi o zaman!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>Döndük ve beraberimizde evden yardımcılar da getirdik! O halde bahçeyi oluşturalım!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Vay canına, etkilenmedim diyemeyeceğim. Sen bu işte gerçekten iyiymişsin. Bu küçük bahçe çok güzel. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>Ayrıca çok da kullanışlı. İşçiler artık tedavi görüyor ve çok yakında köprüyü inşa edebilecek!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Yardımcı olduğuma sevindim."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"Aslında konusu açılmışken Rahip senin ne kadar erdemli ve bilgili biri olduğundan bahsediyordu. Demek istediğim şey..."],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Deneyimli bir maceracı ve yüce bir kişilik olarak bize katılman bizim için onur verici olurdu. Ama sen bir efsanesin! Bizim gibi garip yabancılara katılman mümkün değil! Katılır mısın? Lütfen? Lütfen bizimle gel!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Tabii. Belki de tam olarak bu yüzden buraya gönderildim."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Bunu biliyordum. Kabul etmeyeceksin... NE?! Bizimle mi geliyorsun?! İnanmıyorum...... HAYATIMIN en güzel günü! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Kusura bakma, bazen çok heyecanlanabiliyor. Artık bize katıldığına göre senin için bir hoş geldin partisi düzenlemeye ne dersin?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"Yok, partisiz de iyiyim. İlgilenmem gereken daha önemli meseleler var. Yıktığım köprüyü yeniden inşa etmek için biraz odun bulacağım."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>Ne kadar da onurlu bir adam! Of! Onunla tanışmak bile...... HAYATIMIN en güzel günü!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>Sen Şefsin...... değil mi? Yardımın için teşekkür ederim. Artık köprüyü yeniden inşa etmeye hazırız."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>Yenisi kadar güzel! Şimdi, Tanrı ile tekrar konuşmaya hazır mısın Rahip Enda?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>Hiçbir zaman bu kadar hazır olmamıştım! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Tamamdır Şef. Rahip çok sevdiği sunağında kavuşmanın tadını çıkarırken biz de biraz çalışabiliriz..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Ah, ayağıma takılan şey de neydi? Ha, anlıyorum, <color=#f58c26>Sunak'a</color> ait bir <color=#38c0a5>Yabani Cevher</color> parçası. Çalışırken gerçekten çok dikkatsiz oluyorsunuz."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>Aha, biliyorum! Kaynakları depolamak için bir <color=#f58c26>Depo</color> inşa etmeliyiz; böylelikle artık insanların ayağı yerlere dağılan malzemelere takılmayacaktır."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>İhtiyacımız olan her şey tamam mı? O halde parti başlasın! Pardon, </color>Depo<color=#f58c26> başlasın diyecektim."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Sağlam duvar, güzel ve büyük alan... Harika inşaatçılık, Şef!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Ah......Efendim? Arkanızda sekiz ayaklı bir şey var."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"Ne?! Nasıl olur?! Bu da ne?! Suda yaşayan bir yaratığın vücuduna benziyor... Hmm, derisi de yapışkan ve esnek!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Kraken</color>! Bu bir <color=#f58c26>Kraken</color>! Kitaplarımda bunlarla ilgili bazı şeyler okumuştum! O canavarın yavrusu olmalı! Orada neden bir <color=#f58c26>Kraken</color> var?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"Panik yapmaya gerek yok. İlk olarak olumlu açıdan bakacak olursak bu ölmüş. İkinci olaraksa bu canlı yalnızca karaya oturmuş sıradan bir <color=#f58c26>Ahtapot</color>."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Ahtapot? İlk kez duyuyorum..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Demek ki denizden uzak yerlerde yaşıyordunuz, ha? Benim halkım göçebedir. Biz denize bağlı yaşarız. Bizim için ahtapotlar, geceleri gökteki yıldızlar kadar sıradandır."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"Ne diyeceğim, benimle gel. Biraz ip ve dal bulalım. Sana ahtapot derisinden nasıl çadır yapıldığını göstereceğim."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>...... ve oldu... Çok daha güzelini hayal ediyordum."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>Bu... ha... ha... harika!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Kusura bakma. Elimden daha çok zihnim çalışır. İnşaat konusunda pek de becerikli olduğum söylenemez. Şimdi...... Biraz yatsam iyi olacak......"],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"Yüce Amergin! Neden gidip büyük çadırda dinlenmiyorsun? Ben de yanında olacağım! Bilgeliğini bana açtın ve sonsuza dek hizmetinde olacağım."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Rahibin çocukluk hayali gerçekleşiyor olmalı. İkisinin birbiriyle geçiniyor olduğunu görmek güzel. Ancak sanki her şeyde bir gariplik varmış gibi, öyle değil mi şef?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Yaşlılar, denizde seyahat edenlerin asla geri dönemediğini ancak bir kişinin döndüğünü ve onun da delirmiş olduğunu ve dünyanın sonunda devasa bir sudan bariyerin olduğundan bahsettiğini anlatırdı."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>Yine de Amergin su halkından geldiğini söylüyor. Hiç kimse denizde yaşayamaz ki!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>Bu yüzden ilgi çekici bir durum. Ama yine de bize zarar vermiş değil. Şimdilik elimizdeki işlere bakalım. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Etrafı keşfettik ve inanılmaz miktarda malzeme bulduk. Bazı hayvanlar bunları eve taşımamıza yardımcı olabilir. Rahat etmelerini sağlamak için onlara bir <color=#f58c26>Hayvan Ahırı</color> inşa edebiliriz."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Güzel görünüyor, Şef! Görünüşe göre bu küçük adamlar işimize yarayacak, harika!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>İnşaat işlerimiz neredeyse tamamlandı ama yine de bize yardım edebileceğin bir şey var."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>Kampın başından ayrıldıktan sonra kötü niyetli insanların gelip kampımızı mahvetmesine engel olmak için bölgede devriyeye çıkıp buradaki emeğimizi koruyacak profesyonel gözcülere ihtiyacımız var."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>Bir <color=#f58c26>Eğitim Ringi</color> gerekiyor!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Doğru söylüyorsun Kevin, bir <color=#f58c26>Eğitim Ringi</color>. Gidip biraz malzeme bulalım!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Hazır mısın?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>Evet efendim!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>Şefin malzemeleri hazırlamasıyla birlikte artık işe koyulabiliriz!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Evet efendim! Sorun yok efendim!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Harika! Şimdi...... Rahip? Sorun nedir?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Baş Druid Amergin ile konuşuyordum; ardından ikimiz de yorgunluktan uyuyakaldık ve ikimiz de aynı rüyayı gördük. Rüyada tanrıça bize "<color=#f58c26>Denizin Kalbi'ni</color> Kurtarın......" diyordu."],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Denizin Kalbi</color> mi? O da nedir?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"Tanrıçaların en genci tarafından korunan denizdeki büyük bir baloncuk ile ilgili eski bir hikayemiz vardı. Bu baloncuğun içinde antik çağlardaki hayvanlar hayatta kalmış; ayrıca burada devler ve periler de hala yaşıyormuş. Yine de basit bir uyku masalından fazlası değildi."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Bu gizemi çözmem gerekiyor. Tanrıça'dan daha anlaşılır bir mesaj alabilmek için <color=#f58c26>Güçlü Rune Üssü'ne</color> ihtiyacım var."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Anlaşıldı. Tamamdır Şef, gidip biraz yabani cevher bulalım ve Enda'nın istediği üssü inşa edelim."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>Neredeyse bitti! Kutlama yapmalıyız!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Yaşasın!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Henüz kutlamaya başlamayın! Siz yaygara koparırken işime odaklanamıyorum!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>Tanrı ile yeniden irtibat kurmaya çalışıyordum ve siz gürültücü aptallar her şeyi mahvettiniz!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Çenenizi kapatıp beni rahat bırakın!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Hah, görünen o ki birileri pek iyi bir gün geçirmiyor."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Dur! Şşşş! Sanırım onu duyabiliyorum. Bu çok önemli."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Hmm... Çok net duyamıyorum ama anladığım kadarıyla... Hiçbir şeyin yetişmediği ve hiç kimsenin hayatta kalamadığı kuzeye doğru gitmeliyiz. Orada bir dost bulacağız."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Pekala, sanırım...... mümkün? Yani ne olabilir ki? Kuzeye o halde! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Ama ondan önce nihayet yeni Kampımızı kutlamanın zamanı geldi! Toplanın çünkü harika bir parti vereceğiz!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Yaşasın!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Bir daha asla geri dönmeyeceğimizi düşünerek evden ayrıldık, ancak bu inanılmaz adayı bulduk; yeni dostlarla tanıştık ve hatta sonsuza kadar kaybettiğimizi düşündüğümüz kabile üyelerini yeniden canlandırmanın yollarını bulduk."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"Bizimle ilgilenen ve bize rehberlik eden tanrıçamıza ve akla hayale sığmaz bilgilerini bize cömertçe sunan yeni dostumuz sevgili Amergin'e tüm bunlar için teşekkür etmemiz gerekiyor."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Ancak en önemlisi de Şef, güçlü ve iyi biri olmasaydın bunların hiçbirini başaramazdık. Teşekkürler Şef, bizim için yaptığınız her şey için teşekkürler... Ha... Rahip, ağlıyor musun?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Yok... Ağlamıyorum... *burnunu çekiyor*...... sadece...... *burnunu çekiyor* Tamam, ağlıyorum işte. Mutlu oldunuz mu? Seni seviyorum Şef. Sen Şeflerin en iyisisin!! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Haha, sanırım bu her şeyi açıklıyor, Şef. Yolculuğumuzun nasıl olacağını görmek için sabırsızlanıyorum ve bir gün evimizin gizemini kesinlikle çözeceğiz ve evimizi yeniden inşa edeceğiz."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Acele etmeyin çocuklar, az kaldı......"],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>Tanrı kutsasın! Günlerdir çölde yürüyoruz, en azından bana biraz su verebilir misin? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Biraz sabırlı ol! Ben senin yaşındayken...... Hey bu da nedir?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>OOOOOOOOOOOOO!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Rahip?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Ah hayır, orada mısın rahibim? İyi misin?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Yani...... Hala hayattayım...... Hmm, sanırım buraya beni şu sürükledi...... sihirli bir maden mi?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Tanrıya şükür iyisin. Endişelenme, en kısa sürede seni oradan çıkarmak için elimizden geleni yapacağız."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Şef, yakınlardaki tepede terk edilmiş bir bina buldum. İçeride büyük bir hasır halat mekanizması gördüm ama etrafı iğrenç bir pislik içinde."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Sanırım bu bir çeşit <color=#f58c26>Eski Atölye</color>."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Kapısını açıp içeriyi temizlersek rahibi dışarı çekebilmek için bir halat makarası yapabiliriz."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>O halde boş konuşmayı bırak ve makarayı yap!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"Sakin ol rahip! Hava kararıyor, yakında buz gibi olacak! Öncelikle <color=#f58c26>Çadır</color> kurmak için malzeme bulmamız ve herkes dinlendikten sonra bu işi çözmemiz gerekiyor."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>Peki ben ne olacağım?! Burada soğuktan ölebilirim!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Endişelenme, yer seviyesinde gündüz ve gece arasındaki sıcaklık farkı çok fazla olsa da yer altındaki sıcaklık her zaman sabit ve ılık olur. Dayanmaya çalış rahip! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"Sonraki gün......"],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>Güzel uyuduk! Orada her şey yolunda mı rahibim?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>Enerjini nasıl olduğumu sormak yerine beni buradan çıkarmak için harcarsan minnettar olacağım!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>Halletmeye çalışıyoruz, devam etmeden önce bu kapıyı açmak için önemli bazı araçlara ihtiyacım var. Lütfen sakin ol. *Gülümser*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Oraya bir dönersem... Saygısız, minnetsiz, küçük velet…"],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>Of, duygularım çok incindi! Samimi duygularımı nasıl olur da böyle yanlış anlarsın? Seni yine de affediyorum. Şef ve ben hemen döneceğiz!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Tamamdır, giriyoruz! Şimdi yapmamız gereken tek şey......"],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Efendim dikkat! Arkanda!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"Of! Bu ok da nereden geldi?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"Binadan çıkın!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"Kim var orada?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"Dışarı çıkın! Adam kaçırıyorsunuz!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"Adam kaçırmak mı? Sanırım yanlış kişilerin peşindesin, kadın sesi... Of, of, of!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Kadın sesi, şu anda binanın dışındayız. Şimdi bana neler olup bittiğini açıklar mısın?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"Öncelikle benim adım Kadın Sesi değil. Adım Tlachtga. Ben yıldırım avcısı, Mug Ruith'in kızı, tüm toprakların anası ve kahraman......"],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Büyük Tlachtga!!!!!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"Ne...... Bu ses de nereden geldi?...... Tepenin dibinden mi? Bu madene birisi mi düştü?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Siz üçünüz, ben geri dönene kadar bu şekilde bekleyin. Hareket ettiğinizi fark edersem işte o zaman ne olacağını çok iyi biliyorsunuz."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"Evet Hanımefendi, hiç hareket etmeyeceğiz!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"İşte sen. Bir rahip mi? Burada ne yapıyorsun? Birini arıyordum ve o sırada bu madenin girişini açmıştım. Sen nasıl oldu da buraya girdin?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Kısaca anlatmak gerekirse orada yakaladığın üç çocukla birlikteydim ama ben bu madene düştüm. Ancak bu önemli değil. Buradasın! Bu çorak topraklarda bize yardımcı olabilecek bir dostla tanışacağımızı önceden görmüştüm ama bunun senin olduğuna inanamıyorum!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Dost mu? Size yardım etmek mi? Siz... Adam kaçırmıyor muydunuz?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Adam kaçırmak mı? Hayır, hayır, hayır, biz sadece evimizi kurtarmamıza yardımcı olacak birilerini bulmak için buradan geçiyorduk! *Açıklar*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Hah. Şimdi oldu. Annem sizin gibi bir grup insanla tanışmak hakkında bir şeyler söylemişti... Ama sonra ortadan kayboldu... Yani yanlış insanları bulmuşum."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>Annen mi?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Unut gitsin, önemli bir şey değil. Sanırım adamların seni çıkarabilmek için o halat mekanizmasını çalıştırmaya çalıştı. O sırada da benim tuzağıma mı yakalandılar?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Evet bilge hanımefendi, tam da bu yüzden böyle tek ayaklı gibi görünen birine dönüştüm."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Vah vah, benim hatam. Yaralarınla daha sonra ilgileneceğim. Şimdi tuzaklarımı kaldırmama ve senin için şu halat mekanizmasını tamir etmeme müsaade et..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>Hasır halat makinesi düzeldi ve çalışıyor, harika bir iş çıkardın hanımefendi!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>Çok da harika değil! Beni çek! Şimdi, hemen!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Yalnızca bir adım kaldı. Seni oradan çıkarmadan önce yapmamız gereken tek şey hasır halatı ve makarayı hazırlamak."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>Beni hedef alıyormuşsun gibi hissediyorum...... *Gözleri Dolar*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Şefim, malzemeleri şimdiden topladınız mı? Acele etmenize gerek yok çünkü Enda burada olmadığı için artık nihayet biraz kafamızı dinleyebiliriz......"],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>Seni hala duyabiliyorum! Gerek var!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Hay aksi! Bizi duyabildiğini bilmiyordum...... Hah, makara hazır!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Sevgili rahip, kurtarma ekibi aşağıda. Şimdi lütfen yerini belli et ki üzerine basmasınlar......"],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>Üstümde duruyorsun! Çekil üstümden! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>Anlaşılan rahip yakında yukarıda olacak, çok teşekkürler hanımefendi."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Bana hanımefendi demekten vazgeç, benim adım Tlachtga. Şimdi, göster bakalım. Seni az önce nerenden hakladım?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>Beni kavalkemiğimden vurdun hanımefendi, pardon Tlachtga."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>İşte. Benim gibi avcılar, yara açma konusunda profesyoneldir. Madenin aşağısında Etli Bitki Yaprakları ile dolu bir çantam var. Orayı depo olarak kullanırdım. Birazını alıp sıvıyı küçük tatlı bacağına sürelim!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Ha...küçük bacak... pekala. O halde aşağıya şimdi mi gidelim? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"Hayır hayır hayır, sizin gibi küçük zavallıların aşağıyı görmesi için meşalelere ihtiyacımız var. Düşündüğün de derin bir yer. Gidip birkaç meşale ve kazı aleti bul!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Bunu tut! Ateş sönerse dur ve arkanı dön, tamam mı?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Hazır mısın? Haydi bakalım! Adımlarına dikkat et!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Evet Hanımefendi!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Şef, Rahip ve benimle burada kaldığın için teşekkür ederim. Gidemediğim için çok üzgünüm ama Tlachtga ayağımı kaybetmek istemiyorsam burada kalmam gerektiğini söyledi. Bize neler getireceklerini görmek için sabırsızlanıyorum!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>Büyük Tlachtga'nın adıyla seslenmen için sana izin verdiğine inanamıyorum. Ne büyük bir onur! Ama buna rağmen hiç minnet ifadesi göstermiyorsun..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>Tanrım, o da nedir?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>Bu bir yeraltı nehri! Ekibin bir <color=#f58c26>Yeraltı Nehri</color> bulmuş olmasına inanamıyorum! Artık suyumuz var!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>Ayrıca ıslandık."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Biraz güçlü ol seni korkak! Sadece birazcık su! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Hey sen, Şef. Artık suyunuz olduğuna göre biraz etli bitki yetiştirebiliriz. Etli bitkinin yaprağı, birazcık ilahi ve iyi bir bakımla dolgun bir etli bitkiyi en kısa sürede sana vereceğiz!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Bu kızların hepsi sizin, gidip onlar için biraz kova, kürek ve gübre bulmaya çalışın. Ben burada bekliyor olacağım."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>Pekala! Tamamdır, şunun tatlılığına bir bak! Büyük bir parça al."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Daha önce hiç buna benzer bir bitki görmemiştim...... Ne? Bir parça mı al dedin?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Evet bir yaprak al, sıkıp suyunu çıkar ve yaralı tenine sür."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Tamam...... Bir parça al...... Sür...... Vay canına, gerçekten işe yaradı! Yaraları bu kadar hızlı iyileştirebilen bir bitkiden ilk kez haberim oluyor!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"İnsanlar bana tüm toprakların anası diye boşuna demiyor. Sanırım adım aşırı derecede etkileyici Yeşil Baş Parmağımdan geliyor. Bunlar sıradan etli bitkiler değil, kendim yetiştiriyorum."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Mucize yaratan! Hah! Artık evimizdeki gizemi en kısa zamanda çözebileceğimizden eminim! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"Aslında konusu açılmışken, halim kalmadı ve gidip biraz kestirmem gerekiyor. "Evinize" gidip biraz kestirsem sorun olur mu? Eviniz bir tür Üs mü? Yatağınız var mı?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Evet bir tür Üs gibi diyebiliriz; işte bu da geriye dönmek için çizdiğimiz harita. Ama...... Biraz uyumaya mı geleceksin yoksa bize katılacak mısın?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>Elbette size katılıyorum! Aptal mısın?! Yardıma ihtiyacınız var, benim de yapacak bir şeyim yok; bu yüzden neden olmasın? Zaten muhtemelen aynı kişilerin peşindeyiz. İşte bu yüzden! Şu haritayı alayım, görüşürüz!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"İşte gitti. Halkıma çok iyi bir arkadaş olacağını hissedebiliyorum. O halde Kampımızı kuralım. Eski Kampımızda olduğu gibi burada da malzemeleri depolamak için bir <color=#f58c26>Depo'ya</color> ihtiyacımız var."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Hadi gidip <color=#f58c26>Depo</color> için biraz malzeme toplayalım!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Aferin! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>Seni suya götürdüğüm için bana hala teşekkür etmedin! Burasıyla ilgili haklı olduğumu sana söylemiştim!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Pekala, pekala. Geleceğe dair kehanetine tamamen saygı duyacak ve tüm mantıksız isteklerini teker teker yerine getireceğim. Şimdi neye ihtiyacın var?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>Seni...! Neyse. Şimdi nereye gitmemiz gerektiğini öğrenmek için Tanrı ile konuşmam gerekiyor. Bu sefer Astroloji çalışmalarım için bir <color=#f58c26>Gözetleme Kulesi'ne</color> ihtiyacım var. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Neden Astroloji? O yıldızların ne olduğundan bile emin değiliz, yani gökyüzünde parlayan noktalardan başka bir şey değiller!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>Vaktimiz kalmadı! Yapmamız gereken çok fazla iş var! Aptalca konuşmaktan vazgeç!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Gidip ihtiyacımız olan malzemeleri getir ve en kısa sürede geri dönmüş ol!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Peki o zaman..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Büyüklerim yaşlılara asla bulaşmamam gerektiğini söylerdi, neden onlara hiç kulak vermediysem..."],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Tamamdır şefim, sen yapacağını yaptın. Geriye kalan tek şey rahibin benden inşa etmemi istediği <color=#f58c26>Gözetleme Kulesi</color>......"],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>Seni duyabiliyorum serseri! Şikayet etmeyi bırak ve işine bak!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Tamam~tamam~*İç çeker*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Tamamdır şefim, şimdi tanrılarla konuşacağım."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Biraz dinlenebilirsin, az sonra görüşürüz."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Fısıldar* Buradayım şef, buradayım......"],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Enda artık nihayet bir süreliğine durabilir."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>Ekibimiz madenin aşağısında bir yığın altın ve yabani cevher buldu."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Buraya taşımak için bir sandık yapmayı düşünüyoruz. Bu yüzden senden yardım istemeye geldik."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Sandık yapmak için biraz malzeme toplamak senin için sorun olur mu?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Vay, amma da altın varmış. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>Bu parlayan şey de nedir?"],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>Bu küçük bir paket... "Beni ye" diyor. İçinde de bir <color=#f58c26>Parlak Çekirdek</color> mi var? Yani çekirdeği ye mi demek istiyor?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Bana bırak!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>Ne?! Rahip, ne yapıyorsun?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Onu gerçekten yedin mi?! Daha ne olduğunu bile anlayamadık!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"Yıldızlar, <color=#f58c26>Güneydoğu'da</color> kalan <color=#f58c26>Büyük Vadi'yi</color> işaret ediyor ve <color=#f58c26>sakinleştirici çekirdek</color> sayesinde tanışacağım kişi Büyük... *horlar*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>Rahip? Rahip? Orada mısın?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*Horlar*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>Ve uyuyakaldı. Gizemli güçleri olan insanları pek anlayamıyorum. Bazen çok garip davranıyorlar. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Offf, rahip bayıldığına göre şimdi nereye gitmeliyiz?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%><color=#f58c26>Büyük Vadi</color> demişti, öyle değil mi? <color=#f58c26>Güneydoğu'ya</color> o zaman?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Ona güvenmeli miyiz? Şu an pek de... Kendisinde değilmiş gibi?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Evet, kendisine gelecekte güveneceğimin sözünü verdim. Hem zaten başka nereye gidebiliriz ki? Bugünlük dinlenelim, yarın da Güneydoğu'ya doğru yola çıkalım."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>Hey sen!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"Ben mi?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"Evet! Sen. Yaşlı bir hanımefendiye yardım edebilir misin?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Iııı... Ben aslında burada değilim."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"Ha, nedenmiş o?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Kabilemden insanlarla birlikteyim. Evimizdeki gizemi çözmemize yardımcı olacak kahramanları bulmak için bir yolculuğa çıktık."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Anlıyorum. Aslında şu anda senin ruhunla konuşuyorum, elindeki parlayan o küçük parça aracılığıyla."],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"Benim...... <color=#f58c26>telefonum</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Evet aynen öyle. <color=#f58c26>"Benim telefonum"</color>. Bana yardım eder misin?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Dur bakalım...... Beni neden *koklayabiliyorsun*?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Ah tatlım, her ne kadar bir gözüm kör olsa da hala her şeyi algılayabiliyorum. Sonra anlarsın bunu. Şimdi, bana yardım eder misin?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Tamamdır. Neye ihtiyacın var?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"Kabilen buradan geçecek değil mi? Sanki benim yemeğe çok ihtiyacım varmış gibi davran ve döküntülerimi satmak için <color=#f58c26>Küçük Bir Tezgah</color> kur, olur mu? Aman tanrım, muazzam bir plan!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"Anlamıyorum......"],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"Tanımadığım kaba insanlara yardım etmek istemiyorum, anlıyor musun? Yardım etmemi istiyorsan kibar davranmalısın."],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"Yani?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"Eğer sattıklarımı alıp bana yemek verirlerse iyiler demektir. Hatta doğrudan yemek verirlerse çok daha iyi olur!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"Yoksa? Kabilenin yok olması parmağımı bir şıklatmama bakar. Anladın mı? Şimdi git ve benim için biraz malzeme topla!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"Harika! Hepinize çok teşekkür ederim! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"Umarım kızım da senin gibi güvenilir ve çalışkan biri olur. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Bir süre önce çölde birbirimizden ayrıldık ve ben kayboldum...... Yön bulma becerilerim pek iyi değildir. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"Nerede olduğunu biliyor musun?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"Elbette nerede olduğunu biliyorum! Ama o... beni bulamıyor! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"Kendimi iyi hissediyorum biliyor musun? Yalnızca sen ve ben, kafa dinleme, biraz muhabbet ve çay......"],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Geliyorlar. Yalnızca beklememiz gerekiyor."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"Çok zaman geçti."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Şu kemiklerin üstüne tırmanıp nerede olduklarına bakacağım."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"Hah! Kesinlikle oradalar! Sizin şu küçük rahip karşı konulamayacak derecede tatlı biri!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"Pekala, yakında burada olurlar. Halkınla tanışmak için sabırsızlanıyorum. Yalnızca aşağıya dikkatlice inmem gerekiyor......"],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"Sen iyi misin?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"Merhaba?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Biraz sonra"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>""Açım, lütfen bir şeyler alıp bana yemek verin, lütfen". Hmm, görünüşe bakılırsa birileri burada küçük bir işletme kurmuş."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Hah, Şef. İşte buradasın. Rahip Enda'nın dediğine göre rüyasından biri bizi burada bekliyormuş. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"İnsanların burada olduğuna dair izler görüyorum ama bu kamp ateşi sönmüş, bu küçük tezgah yıkılmak üzere ve etrafta hiç kimseyi göremiyorum... Ekildik mi?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"Neyse, bir Kamp kurup geceyi burada geçirelim ve "rüyadaki kişinin" ortaya çıkmasını bekleyelim."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"Yorgunluktan öleceğim... Nihayet... Bu palto fırın gibi! Yandım burada! Üstümden al şunu!!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Sevgili rahip, az önce bir devenin sırtında mışıl mışıl uyuyordun. "Yorgunluktan öleceğim" demeye hakkın yok."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"Bu arada paltonu da çıkaramazsın. Şu anda cehennem gibi sıcak olsa da geceleri hava hala buz gibi."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Tanrım... Neden benden bu ıssız yere gelmemi istedin ve beni bu kibirli genç çocuğa katlanmak zorunda bıraktın?..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"Lütfen biraz daha sabırlı ol. Şef, buraya <color=#f58c26>Çadır</color> kurmak için ihtiyacımız olan malzemeleri toplayacak."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"Tebrikler Şef! Haydi başlayalım!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"Harika! Eminim herkes acıkmıştır. Şimdi bu kamp ateşini sonuna kadar değerlendirip bir şeyler pişirelim. İyi ye, iyi çalış!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"Yaşasın! Yemek! Pastırma!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Ben kuzu pirzolası alayım, lütfen..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"Sizi vahşi etoburlar!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"Peki sen ne istiyorsun?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Biftek, orta pişmiş ve yaban turbu sosu ile birlikte, lütfen."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Rahip, o da..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"Biliyorum! Şşşş!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Haha, yolculuk eden bir vücut için protein çok önemlidir. Zor bir seyahat oluyor, haydi oruç tutalım! Ne diyorsun, Şef?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"Elimizde pişirebileceğimiz çok fazla malzeme yok..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"Elimizde koyun eti, kurutulmuş biftek ve elma var Şef!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Ama Şef haklı, zor geçen geceler için bir kısmını saklayabiliriz. Yani alternatif protein kaynakları bulmamız gerekiyor."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"Bazı çöl kertenkeleleri gözüme ilişmişti. Kertenkele yumurtası ve eti harika birer protein kaynağı olabilir!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"Ne dedin? Kertenkeleler mi? Kertenkeleleri nasıl yiyeceğiz?"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"Zihnimizi açtığımız takdirde yaratabileceğimiz çok fazla lezzet var! Örneğin, "kertenkele yahnisi" kulağa pek çekici geliyor!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"Sabırsızlanıyorum!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Ah...... Kertenkele avı......"],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"Harika! Tüm malzemeleri toplamışsın! Haydi yola devam edelim!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"Geliyor! Kamp ateşi yansın!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Nihayet... Yemek... Daha fazla hareket edemiyorum... Tavada yumurta... Biftek... Pişmiş Elma..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Arlan için koyun pirzola, Kevin için tavada yumurta... Rahip Enda ise benimle birlikte bu leziz kertenkele yahnisini yiyecek..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"Kimsenin kertenkele yahnisi yediği yok!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"I halde bu sıcak, dumanı tüten leziz yahniyi yeni dostlarımıza vereyim."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"Yeni dostlar mı? Hangi yeni dostlar?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"Ah!!! Hayır!!!!! Şu fareleri çek üstümden!!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"Fare olmak için çok iriler. Gözlemlerime göre bunlar Maubbit, arid bölgelerine özgü bir çeşit kemirgen."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"Etkileyici ebatlarına göre genellikle çok çekingendirler ve bu yüzden insanlara karşı tamamen zararsızdırlar."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"Tamam tamam, biliyorum!!! Ne oldukları umrumda değil! Çek şunları üstümden!!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Şimdi sen öyle deyince onların senden hiç korkmuyor olması pek garip oldu......"],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Değerli çalışanlar, bana bir iyilik yapıp şu sevimli yaratıkları rahibin üstünden alır mısınız?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"Evet!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"Hey! Onu geri ver!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Hmm ve gittiler. Görünüşe bakılırsa hala rahip hariç herkesten korkuyorlar."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"Yüzüğümü almışlar! Biricik yüzüğüm..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Zavallı rahip, sanırım ejderha kalıntılarına kadar adımlarını takip edebiliriz, değil mi? Bu ufaklıkları zaten çok merak ediyorum. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"Bu yüzden dağın ne kadar dik olduğunu hesaba katarsak insanları yukarı çıkarıp aşağı indirmek için bir <color=#f58c26>Yeldeğirmeni</color> gerekiyor."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"Bir <color=#f58c26>Yeldeğirmeni</color> yapmak için tüm malzemelere sahip miyiz? Etkileyici!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"Yeni Yeldeğirmeni hemen geliyor!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"Güzel! Artık tepeyi inip çıkmak çok daha güvenli!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"Harika! Çabuk yüzüğümü bana geri getirin! O kutsal bir şey!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"Tamam, tamam gidiyoruz! Kevin, Arlan, hazır mısınız?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"Her zamanki gibi!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Ha...... Efendim...... Korkaklığımdan değil ama uçurumdan düşmeye karşı yine de halatlara ihtiyacımız var sanırım......"],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"Hah, kesinlikle haklısın! İş güvenliği önemlidir! Şef, gidip bize biraz güvenlik ekipmanı getir!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"Şimdi hazır mıyız?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"Evet!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"Çok güzel! Şimdi hemen Maubbitlerin gizemini çözmeye gidelim! Çok heyecanlı!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"Ayrıca yüzüğümü de geri alın!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"Vay canına, bu gerçekten derin bir kemik yığınıymış! Bir dakika... Aşağıda parıldayan bir şey var... Hmm... Enda'nın yüzüğü olabilir mi?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"Şef! Bak ne bulduk! Toprakla kaplı yaşlı bir kadın!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"Bir de Rahib'in yüzüğü."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Gözleri Dolar* Teşekkürler, Arlan. Aramızda en aklı başında insan sensin...... Bir dakika...... Ne?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Heyecanlanma Sesleri*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"Sanırım...... Teşekkür ederim?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Mutluluk Sesleri*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Heyecanlanma Sesleri*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"Merhaba! Selam! Çok sıcakkanlısın! Seni tanıyor muyum? Kürkün bir yerlerden tanıdık geliyor..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"Ah! Sen de rüyamda gördüğüm o küçük rahip olmalısın! Gerçek hayatta daha da tatlıymışsın!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"Küçük mü? Bana küçük demeye nasıl cüret edersin?! Ben Tanrı'nın ulu elçisiyim..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Afedersin, rüyanda rahibi mi gördüğünü söyledin?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"Ah~ Genç adam! Rüyamda küçük rahibe "Seni bekliyor olacağım." demiştim ama bunun ne demek olduğunu hiç bilmiyorum!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"Ne demek olduğunu hiç bilmiyorum derken?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"Aslında bu çok komik. Ben adımı bile hatırlamıyorum, bu yüzden o garip rüyanın ne anlama geldiğini hiç bilmiyorum. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"Çukura düşerken kafamı çok sert çarpmış olmalıyım. Yürürken hala biraz sendeliyorum. "],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"Buradaki küçük tezgah senin mi? Üstünde "Açım, lütfen bir şeyler alıp bana yemek verin" yazıyor."],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"Tezgahta yazılanların tam olarak beni tarif ettiğini ve bir çölün ortasında olduğunu hesaba katarsak evet, sanırım benim tezgahım."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"Ah! Hiç sorun değil! Yemeğimiz var. Çadırımıza gelip yiyebilirsin."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"Harika olur!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"Ha, bir şey daha var. Havada pastırma, pişmiş elma ve...... <color=#f58c26>kopmak üzere olan bir fırtınanın</color> kokusunu alıyorum. Hazırlıklı olmanızda fayda var. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"Ve...... gitti. Pekala, Şef. Eminim buralarda rüzgarın güçlü ve dengesiz olduğunu duymuşsundur, bir bakayım......"],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"Ağırlığını aşağıya vermek için çadırımızın daha fazla güçlendirmeye ihtiyacı var."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"Onu neden dinlemek zorundayız ki? Nereden geldiğini bilmiyoruz ve dediklerine inanıyorsunuz! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"Tahminlerim...... Yaptığım bir hataya takıyorsunuz ve benimle defalarca bunun yüzünden dalga geçiyorsunuz! Bu kadının gerçek yüzünü göstereceğim, bekleyin ve görün!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"Oooo, birileri işi kızıştırıyor. Neyse, Şef, <color=#f58c26>çadırı güçlendirmek</color> için gerekli malzemelerin bir listesini oluşturdum, lütfen bakar mısın?"],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Mmm, çay güzelmiş."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"Bisküvi de çok güzelmiş, ağızda eriyor. Dışı biraz yanmış gerçi ama olsun. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"Bir sonraki sefere sıcaklığı düşürüp daha uzun süre pişirebilirsin."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"Neden akşam çayı içiyor?"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"Sorun nedir?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"Ve o garip İngiliz aksanı da neyin nesi? Daha doğru çağda bile değiliz!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Sakin ol, küçük rahip. Her şey güzel olacak. Anlayacaksın."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"Yok! Hiçbir şey güzel olmayacak! Ayrıca hiçbir şey de anlamayacağım! Yüce Tanrım... Bu kadın da hangi cehennemden çıktı başımıza?......"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Tüm samimiyetinle soruyorsun madem, aslında az önce yudumladığım akşam çayı sayesinde şimdi......"],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Sanırım bazı hatıralarım zihnimde oluştu. Aslında, işin gerçeği, ne yalan söyleyeyim, açıkçası, doğrusu......"],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"Artık şunu söyler misin?!"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"Ayrıca dışarıdaki <color=#f58c26>Küçük Tezgah'ı</color> da benim için güçlendirebilir misin?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"Ne?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Günlerce tek başına yürüyen sıska ve yaşlı ben, aç karnına bu tezgahı yaptı...... Ah, zavallı kadıncağız!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Tezgah yıkılırsa benim için tam bir facia olur. Kaderim senin ellerinde! Pek minnettar olacağım!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Ne ilginç bir kadın."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"Pardon, ne dedin?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Şef, senin için bir malzeme listesi oluşturdum, lütfen gidip bakar mısın?"],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"Beni görmezden gelme!!!!! Tanrım, artık buna katlanamıyorum!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"Çok güzel! Harikasınız!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"Anne! Biliyordum! Sen olduğunu biliyordum!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"Büyük Tlachtga, burada ne yapıyorsun?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"Ve bu genç hanımefendi?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"Tlachtga! Senin kızın! Salağa yatmaktan vazgeç! "],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"Elçi bana kemik yığınından bir kadını çıkardıklarını söyledi. Anlattıkları tıpkı seni tarif ediyordu ve ben de gelip bakmak istedim."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"Seni burada gördüğüme hiç şaşırmadım."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"Tlachtga'nın annesi... Tlachtga'nın bir annesinin olduğunu hiç duymamıştım..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"Elbette annem var, göt lalesi!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Küfür etmeyelim."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Her neyse, işte bu çılgın kadın Mug Ruith olur, tam önünüzde duruyor."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Bana lütfen Meg deyin."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"Ama Mug Ruith'i erkek sanmıştım..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"Doğrusu annem hikayelerde birçok farklı şey olabiliyor. Ben küçükken gerçek kimliğini insanlardan saklamış."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Çünkü bilirsin, kör bir kadından ve üç yaşındaki çocuğundan başka kim istismara daha müsait olabilir?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Sanırım hikaye işte bu şekilde yayılmaya başladı... Her şeye gücü yeten ve her şeyi bilen bir rahip, kör bir savaşçı ve görkemli bir şovalye..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"Halbuki o sadece garip bir mizah anlayışı olan kör bir kadın."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith bir kadın ve Mug Ruith'e kaba davrandım... Ah... Şimdi mahvoldum... Rahiplerin yüz karasıyım..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Küçük rahip, lütfen bu kadar karamsar olma. Artık eskisine göre daha kibar olacaksın~ Tatlı olduğun için seni bu seferliğine affediyorum!~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"Yani bizi kandırdın mı? Hafızanı kaybetmemiş miydin?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Evet... Kusura bakmayın. Uzun yolculuklar sıkıcı olabiliyor, biliyorsunuz. Biraz eğleneyim dedim~ "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Ama şu güzel çadıra ve güzel tezgaha bakın! İşte şimdi bir Kamp gibi görünmeye başladı! Yine de eksik olan bir şeyler var gibi......"],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"Ne eksik?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Bir bakayım..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"Bir kapı! Kamp'ın girişini işaretlemeniz gerekiyor ve birkaç ışıkla efsanevi görünecektir!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"En sadık hizmetçileriniz olacak ve o kapıyı inşa edeceğiz, hanımefendi! Şef, haydi toparlan!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"Her şey hazır mı? Güzel! Haydi çalışalım, çalışalım!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"Ah! Ne kadar da ihya edici! Bu, hayatımda yönettiğim ilk inşaat projesi......"],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Tebrikler, Rahip, çok olgunlaştın. Fakat Meg'in Kampımızın görüntüsünden yeterince memnun olup olmadığından emin değilim."],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Geri kalan her şey yolunda ama bu boş gökyüzü nispeten donuk görünüyor......"],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"Biliyorum! Biliyorum! Elimizde gökyüzünde süzülebilecek sinyal balonları var!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"Bu harika bir fikir! Sadece işe renk katmak için birkaç ayarlama yapmamız gerekiyor! "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"Elinizde o parlayan sarı ve pembe taşlardan kaldı mı?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"Evet var!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Harika. Müsaadenizle. Kevin, gel."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Of, birazcık yorucuydu. Ama şunlara bakar mısın, çok güzel değiller mi?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Evet, öyleler."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Beğenmene sevindim. Annemin normal şeyler yaptığı az görülür. Neyse geç oluyor, artık geri döneyim. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"Şimdiden ayrılıyor musun?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Evet, yoksa ne? O ufak çadırınızda sizin gibi kokuşmuş adamlarla yatacak halim yok ya! Anne, benimle geliyor musun?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Sonra görüşürüz. Yeni arkadaşların çok sevecen insanlar, özellikle de şu tatlı küçük rahip~! Onlarla biraz vakit geçirmek istiyorum~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Anne, kendine hakim ol."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Biliyorum, biliyorum. Şu anda kontrol bende. Sonuçta, önümüzde hala bizi bekleyen uzun bir yolculuk var."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Peki o zaman. Görüşürüz."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"Az önce bize katılıyor olduğundan mı bahsettin?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"Elbette, neden olmasın? Maceranız inanılmaz derecede tehlikeli olacak. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"Yapabileceğim pek bir şey yok ama en azından gelecekte yaşayacaklarınıza biraz ışık tutabilirim."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Ama Ev'inizin yolunu bana göstermeniz gerekiyor. Yön duygum....... Hayal edemeyeceğiniz kadar kötü."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Ah... Yeryüzünde neden böyle bir yer var?! Ayaklarım hiç durmadan alevlere basıyormuş gibi..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"Gerçekten mi? Enda! Of... Dört saatten beri beş kelimeden fazla etmedin."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Ben… Çok yorgunum… Çok sıcak…"],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"Bir avuç kırılgan oyuncak bebek gibisiniz! Bu sadece bir volkan. Her an bayılacak gibi duruyorsunuz!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Hanımefendi… Siz de kan ter içindesiniz. İyi misiniz?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"Bana Tlachtga de!... Yorgun falan değilim ama gerçekten burası çok sıcak… Ki bu denizden daha tehlikeli."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"Görünüşe göre geldik."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"Bir bakayım! Tanrıça'nın talimatına göre içinde adalar olan alevler içinde bir deniz var..."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"Evet, burada olmalı!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"Ama Amergin nerede? Amergin bizden önce gelip burada bekliyor olmalıydı. Ama hiçbir yerde göremiyorum."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Amergin'in izlerini sezmek için bir sunak inşa etmeliyim. Ama…"],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"Ah… Şef, Ben…"],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"Sıcak çarpması geçirmiş olmalı! Acele et! Dinlenmesi için bir gölgelik inşa et!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"Efendim, inşaat tamamlandı!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Tanrıçam, biraz daha yaşayabilirim gibi görünüyor…"],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"Gerçekten çok sıcak! Denizin kokusunu özlemeye başladım..."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Oh, rahip çok daha iyi görünüyor."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"Bizi bunaltıcı sıcaktan koruyan bir çadıra sahip olmak biraz iyi..."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Ama sadece biraz."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"Tanrıçam, Lütfen beni diğer tarafa çevirin, böylece eşit derecede pişebileyim..."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"Bunu söylemem gerekir ki burası büyük bir soba gibi hissettiriyor."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"Bakın! Orada bir düz arazi var!"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"Geri çekilin! Annem kelimenin tam anlamıyla bir dahi doğurmuş."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"Harika Tlachtga! Su bulduk! SU!!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Ha, bir an dindar rahibimizin Tanrıçayı gördüğünü sandım."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"Hayata döndüm ve kendimi çok iyi hissediyorum!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"Daha enerjik olduğunuzu görebiliyorum."],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"Öyleyse... Sen, sen ve sen, acele edin ve bir Eğitim Halkası inşa edin!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"Eğitim Halkası?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Evet, doğru duydun."],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"Amergin'i aramamız gerekmiyor mu?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin… O yaşlı adam. Doğanın güçlerini bir çocuk oyuncağı gibi kontrol edebileceğini biliyorum."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"Sana dönecek olursak, buraya yürümek neredeyse hayatının yarısını aldı. Fiziksel eğitimi nasıl geride bırakabiliriz?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"Diyorum ki, Enda'nın biraz egzersize ihtiyacı var."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"Kapa çeneni!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"Annemin kehanetine göre bizi çok daha güçlü fırtınalar bekliyor."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"Mug Ruith'in kehaneti..."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"Genç adam!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"Anlaşıldı!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"Kuzeydeki araziye bakın! Orada doğal bir merdiven var."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"Evet efendim!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"Ortadaki sütunu fark ettin mi? Bu doğal bir şekilde oluşmuş olamaz. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"Bu yükseklik ve bu şekille... Rahip ailemin itibarının üzerine bahse girerim ki bu bir eski sunak olmalı!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"Çok ıssız görünüyor."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Doğru, çok eski olmalı."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Archdruid'in gücüyle yankılanamayan böyle bir sunak, Amergin'i bulmamıza yardım edemez."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Şef, enerjiyi yoğunlaştırabilen bir cihaza ihtiyacımız var..."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"Yapıldığı malzemeler buradaki yüksek sıcaklığa dayanabilmeli ve şekli içe dönük olmalı."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"Lavın yanındaki garip dişlere ne dersin?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"Fena değil, Arlan! Tanrıça'nın vedalaşmasının "her zaman önemli ortaklara yakın dur" demesine şaşmamalı!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"Kesinlikle! Tanrıça'ya şükürler olsun!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"Kapa çeneni! Sen dahil değilsin!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"Tüm malzemeleri muhteşem şefimize bırakalım!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Şef, çok iyi ilerleme kaydediyoruz."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"Sunak kullanım için hazır!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"Ama kasvetli gökyüzüne bak! Enda, sunak merdivenlerinden inip çıkmakta zorlanıyor. Ya düşerse?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"Çok da kötü değil, bir şey... Her zaman o kadar da can sıkıcı değilmişsin sanırım."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"Sonuçta, Enda yaşlı… Yani… Genç değil."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"Beni sinirlendirince eline ne geçiyor?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Merdivenlerin iki yanına meşaleler dikelim. Çok basit!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"Bu sunakta hala bir şeyler eksik... Tanrıça'yı hissedemiyor bile…"],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"Ama Amergen'i hissetmek yeterli olmalı!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"Soğuk…ah…Orada kim var?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"Amergin! Neredesin?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"Sen… sen Enda mısın? Nerede olduğum hakkında hiçbir fikrim yok… Ama burası çok soğuk…"],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"Soğuk mu?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"Görünüşe göre o burada değil."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"Hareket edemiyorum… Yardım, $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"Ne dedin?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Hey, Enda. Galiba…"],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"Amergin! Dayan! Biriyle konuşmam lazım o sana yardımcı olabilir."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, daha önce böyle bir şeyle karşılaşmış mıydın?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Hey…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"Spiritüel iletişim benim uzmanlık alanım değil. Ama annem de aynı durumla karşılaşmıştı. Sorun sunakta olmalı."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"Sunağın gücü hala çok zayıf. En önemli şey eksik."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"Tanrıça'nın gücü… @#$>:%^Özü"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Şef, sanırım sorunu anladım. Sunağın sütununun üstündeki boşluğa bakın!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Ruh Özünü doldurmamız ve sunağın gücünü arttırmamız gerekiyor. Bizde hiç var mı?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"Ne diyorsun? Arlan, Sana hemen verebilirim."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"Bu iş bende!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"Amergin, bir şey söyle!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Gelip beni bulmalısınız…"],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"Galiba işe yaradı. Sesin sonunda sahte öksüren Meg kadar belirsiz çıkmıyor."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg sadece yaşlı bir kadın."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Dediğin gibi..."],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"Bir keresinde volkana ulaşmıştım ama sonra ne olduğu hakkında hiçbir fikrim yok. Uyandığımda, bu lanet olası yer her neyse, kendimi burada buldum."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Sunağınız bana ulaşabilse de, sanırım sizi bulunduğum yere getiremez…"],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Çünkü Enda'yı hissedip cevap verebilsem bile, bulunduğum yer... Kendini saklamayı başaracak."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"Herhangi bir fikrin var mı?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Çevreyle bir ol…Sonuna kadar… Ve bir sirkülasyon oluştur."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"Ne demeye çalışıyorsun? Buradaki alevler senin olduğun buz mahzenine mi aksın?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"Seni kalın kafalı öğrenci! Tabii ki de hayır."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Sirkülasyon… Bırakın lav, kül etmek için aksın, küller yükselsin ve kayalara dönüşsün ve sonunda kayalar tekrar lavlara dönüşsün."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"Sen gerçekten en zeki öğrencisin."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"Bekle!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"Bu… Bu bir domuz kafası mı?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Hı-hı."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"Affınıza sığınarak soruyorum, neden bir domuz kafası şeklinde?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Bekle, bu soruyu sormamalıydım."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"Tanrıçam! Sevgili partnerlerimize başarıya giden yolda ihtiyacımız olacak. Neden buradan ayrılmıyoruz sevgili partnerim?"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"Bakın rahibimiz ne kadar sevimli! Ne kadar da güzel bir kibar olma yolu. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"Sen!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Yoldan çekil, şef ve ben sunağı başlatmak üzereyiz."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"Huh... Enda, şov zamanı geldi."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin içerde…"],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"Uzak Doğu... Buzlu ve yasak bir yer."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Burası ne kadar sıcak olsa da bence kışlık giysiler hazırlamaya başlamalıyız."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
14293=>["Value"=>14293,"TextKey"=>"名称ID1050202","TextValue"=>"Arlan"],
14294=>["Value"=>14294,"TextKey"=>"名称ID3040407","TextValue"=>"Arlan ve Kevin"],
14295=>["Value"=>14295,"TextKey"=>"名称ID1020301","TextValue"=>"Amergin"],
14296=>["Value"=>14296,"TextKey"=>"名称ID1010201","TextValue"=>"Enda"],
14297=>["Value"=>14297,"TextKey"=>"名称ID1090102","TextValue"=>"Kevin"],
14298=>["Value"=>14298,"TextKey"=>"名称ID3010101","TextValue"=>"Yaşlı Kadın"],
14299=>["Value"=>14299,"TextKey"=>"名称ID3080210","TextValue"=>"Meg"],
14300=>["Value"=>14300,"TextKey"=>"名称ID3080215","TextValue"=>"Mug Ruith"],
14301=>["Value"=>14301,"TextKey"=>"名称ID3010102","TextValue"=>"Sen"],
14302=>["Value"=>14302,"TextKey"=>"名称ID3060401","TextValue"=>"Maubbitler"],
14303=>["Value"=>14303,"TextKey"=>"名称ID2030204","TextValue"=>"Tlachtga"],
14304=>["Value"=>14304,"TextKey"=>"名称ID1010101","TextValue"=>"Tristan"],
14305=>["Value"=>14305,"TextKey"=>"名称ID4060103","TextValue"=>"Amergin'in sesi"],
14306=>["Value"=>14306,"TextKey"=>"名称ID30400301","TextValue"=>"Watt"],
